import styled, { css } from 'styled-components';
import { bp } from '../../styled/mixins';
import { HEADER_HEIGHT, WIDTHS } from '../../styled/sizes';
import { CUSTOM_PROPERTIES } from '../../styled/colors';
import MaxWidthContainer from '../MaxWidthContainer';

export const StyledNav = styled.div`
	display: flex;
	justify-content: space-between;
	align-items: stretch;
	flex-wrap: wrap;
	padding: 16px 0;
	height: 100%;

	a {
		color: ${CUSTOM_PROPERTIES.COLOR_TEXT};
	}

	${bp(
		WIDTHS.M,
		css`
			flex-wrap: nowrap;
		`
	)}

	& .logo {
		margin: 0;
		font-size: 2.5rem;
		line-height: 1;
		font-family: 'Publico', serif;
		width: 100%;
		text-align: center;
		display: none;

		a {
			line-height: 1;
		}

		${bp(
			600,
			css`
				display: block;
				margin-bottom: 16px;
			`
		)}

		${bp(
			WIDTHS.M,
			css`
				width: 250px;
				text-align: left;
				margin: 0;
			`
		)};

		a {
			color: ${CUSTOM_PROPERTIES.COLOR_TEXT};
			text-decoration: none;
			border-color: transparent;

			&:focus,
			&:hover {
				color: ${CUSTOM_PROPERTIES.COLOR_TEXT};
			}
		}
	}

	.menu {
		display: flex;
		align-items: center;
		justify-content: center;
		flex-wrap: wrap;
		list-style: none;
		margin: 0;
		padding: 0;
		width: 100%;
		color: ${CUSTOM_PROPERTIES.COLOR_TEXT};

		${bp(
			WIDTHS.M,
			css`
				justify-content: flex-end;
			`
		)};

		& .item {
			display: inline-block;
			margin: 0;
			line-height: 1;

			&:not(:last-child) {
				margin-right: 8px;
				${bp(
					600,
					css`
						margin-right: 15px;
					`
				)};
			}

			a {
				color: ${CUSTOM_PROPERTIES.COLOR_TEXT};
				font-size: 1.4rem;
				border-color: transparent;
				line-height: 1;

				${bp(
					362,
					css`
						font-size: 1.6rem;
					`
				)};
			}

			&.is-active {
				a {
					color: ${CUSTOM_PROPERTIES.COLOR_WHITE};
					background-color: ${CUSTOM_PROPERTIES.COLOR_TEXT};
				}
			}
		}
	}
`;
